import {React,useState} from "react"
// import Cart from "../cart/cart";
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import Modal from '@mui/material/Modal';
import { Button } from "@mui/material";
import Cart from "../cart/cart";
const style = {
  position: 'absolute',
  top: '50%',
  left: '50%',
  transform: 'translate(-50%, -50%)',
  width: 400,
  bgcolor: 'background.paper',
  border: '2px solid #000',
  boxShadow: 24,
  p: 4,
};

const Header = () => {
  const [open, setOpen] = useState(false);
  const handleOpen = () => {
    setOpen(true);
    return <Cart  opened = {open}/>
  }
  const handleClose = () => setOpen(false);
  return (
    <>
    <nav class="navbar navbar-light bg-light justify-content-between">
      <a class="navbar-brand">ReactMeal</a>
      <form class="form-inline">
        <button class="btn btn-outline-success my-2 my-sm-0" type="submit" onClick={handleOpen}><span>cart</span><span>0</span></button>
      </form>
    </nav>
    <Modal
    open={open}
    onClose={handleClose}
    aria-labelledby="modal-modal-title"
    aria-describedby="modal-modal-description"
  >
    <Box sx={style}>
      <Typography id="modal-modal-title" variant="h6" component="h2">
        Text in a modal
      </Typography>
      <Typography id="modal-modal-description" sx={{ mt: 2 }}>
        Duis mollis, est non commodo luctus, nisi erat porttitor ligula.
      </Typography>
      {/* <Button onClick={handleClose} type="button">Close</Button> */}
    </Box>
  </Modal>
  </>
  );
};
export default Header;
